css:
.nav > li > a {
  border-radius: 2px;
}
.nav > li > a:hover {
  background-color: rgba(0, 0, 0, 0.1);
}
.nav.nav-pills > li.active > a {
  background-color: #6aa5e9;
}
h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: inherit;
}
body {
  font-family: inherit;
  font-size: inherit;
}
.tooltip {
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 11px;
}
kbd {
  color: inherit;
  background-color: none;
  box-shadow: none;
}
